I am old (and, hopefully wise) enough to understand that
politics in the trenches has always been ugly.&nbsp;
What we have witnessed in the past few years, however, has gone beyond
ugly and has strayed into dangerous territory – that of wielding political
power ahead of the well-being of our Republic – or even national security. 

We can all rightfully wring our hands at how Trump acted after the election but not without at least acknowledging that his entire term was under continuous attack based on information made out of whole cloth. 

Many Democrats (Pelosi, Schiff, et al) were so disingenuous throughout, it gives one pause to wonder why they are suddenly <em>allowing</em> the Hunter Biden story into the public now.&nbsp;

A slightly rational individual might believe it is because the investigation is getting dangerously close to exposing the truth about Hunter, so the MSM may as well get out in front of it (without, of course, apologizing for the ever-so-<em>slight </em>delay).&nbsp;

But a more cynical person (who, me?) may believe it is another part of their master plan based on the obvious and often embarrassing shortcomings of Joe Biden.&nbsp; Might they be considering using the 25th Amendment?&nbsp; They already managed to get one president elected from his basement; surely they can keep Harris in the basement until 2024 when they can run some, hopefully more coherent candidate.

The only problem is that Harris never sticks to the script either.  That may merely get them out of the frying pan...

But Art both parties have lost trust for totally different reasons.&nbsp;

The Progressives have been chipping away at the body and soul of America since at least the 60s. (Actually it started with Wilson and then boosted by FDR). They control the media, the schools and Hollywood. When Obama entered (I want to fundamentally transform America) the chipping switch to dynamite on steroids. 

The Republicans allowed this to happen.

Did you actually read the letter signed by both Democrat and Republican intelligence officials?  Show me where they definitively said the laptop or the emails was Russian disinformation.

