"It is for all these reasons that we write to say that the arrival on the US political scene of emails&nbsp;purportedly belonging to Vice President Biden’s son Hunter, much of it related to his time&nbsp;serving on the Board of the Ukrainian gas company Burisma, has all the classic earmarks of a&nbsp;
Russian information operation.&nbsp;

We want to emphasize that we do not know if the emails, provided to the New York Post by&nbsp;President Trump’s personal attorney Rudy Giuliani, are genuine or not and that we do not have&nbsp;evidence of Russian involvement -- just that our experience makes us deeply suspicious that the&nbsp;
