"Hunter Biden spent years entwining the family in questionable ventures in Ukraine, Russia and China, even as his father’s biggest foreign-policy concerns are Ukraine, Russia and China.&nbsp;
This history raises legitimate questions about counterintelligence and extortion, even as it puts a spotlight on how honest President Biden has been in claiming no knowledge of his son’s doings."
... It's time for a reckoning!

